import styled from "styled-components";
import { IconContext } from "react-icons";
import { IoLogoHtml5, IoLogoCss3, IoLogoJavascript } from "react-icons/io";
import { IoLogoReact } from "react-icons/io5";
import { SiSass, SiTypescript } from "react-icons/si";

interface iconStyle {
  value: object;
}

export const IconStyleContext = styled(IconContext.Provider)<iconStyle>`
height: 5em;
width: 5em;
color: white;
padding-left: 1rem;
animation: 20s ease-in slideIn;`;

export const LogoHtml = styled(IoLogoHtml5)``;
export const LogoCss = styled(IoLogoCss3)``;
export const LogoJS = styled(IoLogoJavascript)``;
export const LogoSass = styled(SiSass)``;
export const LogoTS = styled(SiTypescript)``;
export const LogoReact = styled(IoLogoReact)``;


export const shutuptTS = styled.div`
color:red;
`;
